import ExpenseItem from "./components/ExpenseItem";

function App() {
  // We are storing all the data as a list of objects that will store all the necessary data
  // Here we are Moking an API that is giving as class objects with data that then will be used in the fonrt-end

  const expenses = [
    {
      id: "e1",
      title: "Toilet Paper",
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  // We are going to make this 'ExpenseItem' component configurable depending on the body we get from a the list
  return <div></div>;
}

export default App;
